import React, { Fragment, useState } from "react";
import Multistep from "react-multistep";

import StepOne from "./StepOne";
import StepTwo from "./StepTwo";
import StepThree from "./StepThree";
import StepFour from "./StepFour";
import PageTitle from "../../../layouts/PageTitle";

const Wizard = () => {


  const [selectedClient, setSelectedClient] = useState([]);


  const steps = [
    { name: "Personal Info", component: <StepOne /> },
    { name: "Company Info", component: <StepTwo /> },
    { name: "Business Hours", component: <StepThree /> },
    { name: "Email Setup", component: <StepFour /> },
  ];
  const prevStyle = {
    background: "#43DC80",
    borderWidth: "0px",
    color: "#fff",
    borderRadius: "4px",
    fontSize: "14px",
    fontWeight: "600",
    padding: "0.55em 2em",
    border: "1px solid #43DC80",
    marginRight: "1rem",
  };
  const nextStyle = {
    background: "#43DC80",
    borderWidth: "0px",
    color: "#fff",
    borderRadius: "4px",
    fontSize: "14px",
    fontWeight: "600",
	border: "1px solid #43DC80",
    padding: "0.55em 2em",
  };
  return (
    <Fragment>
      <PageTitle activeMenu="Contrat" motherMenu="Nouveau contrat" />

      <div className="row">
        <div className="col-xl-12 col-xxl-12">
          <div className="card">
            <div className="card-header">
              <h4 className="card-title">Form step</h4>
            </div>
            <div className="card-body">
              <form
                onSubmit={(e) => e.preventDefault()}
                id="step-form-horizontal"
                className="step-form-horizontal"
              >

                <StepOne 
                setSelectedClient={setSelectedClient}
                selectedClient={setSelectedClient}
                />
                <StepTwo

                />
                <StepThree 

                /> 
                <StepFour 

                /> 

              </form>
            </div>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default Wizard;
